import React from "react";
import { Menu, Input, Button, Row, Col } from "antd";
import Link from "next/link";
import PropTypes from "prop-types";

const AppLayout = ({ children }) => {
	return (
		<div>
			<Menu mode="horizontal">
				<Menu.Item key="home">
					<Link href="/">
						<a>나비넷</a>
					</Link>
				</Menu.Item>
				<Menu.Item key="profile">
					<Link href="/profile">
						<a>프로필</a>
					</Link>
				</Menu.Item>
				<Menu.Item key="mail">
					<Input.Search
						enterButton
						style={{ verticalAlign: "middle" }}
					/>
				</Menu.Item>
			</Menu>
			<Link href="/signup">
				<a>
					<Button>회원가입</Button>
				</a>
			</Link>
			<Row>
				<Col xs={8}>첫번째</Col>
				<Col xs={8}>두번째</Col>
				<Col xs={8}>세번째</Col>
			</Row>
			{children}
		</div>
	);
};

AppLayout.propTypes = {
	children: PropTypes.node
};

export default AppLayout;
